import Axios from 'axios';

class MyBackpackViewStore {
    constructor(rootStore) {
        this.rootStore = rootStore;
        this.actions = {
            returnItem: async (id) => {
                debugger
            }
        }
    }

    navigateDashboard = () => {
        this.rootStore.routerStore.goTo('dashboard');
    }
}

export default MyBackpackViewStore;
